import React from 'react';
import './FeaturedImage.css';

class FeaturedImage extends React.Component {

  render() {
    return (
      <section className='inner-container featured-image-wrapper'>
        <img src={this.props.selectedBreedByDefault} alt='Dog' width='400' height='400' />
      </section>
    );
  }

}
export default FeaturedImage;
